import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const CloneDisp = (props) => {
    return (
    <>
    <div className = "container" style = "">
        <h4>{props.title}</h4>
        <p>{props.content}</p>
    </div>
    </>
    );
}

export default CloneDisp;
